drop table GBTPhase_Static cascade constraints; 
DROP SEQUENCE GBTPE_ID_seq;

CREATE TABLE GBTPhase_Static
(  GBTPE_ID NUMBER PRIMARY KEY,
	link_ID INT NOT NULL,
   SOL_CRATE VARCHAR(20) NOT NULL,
   GBTPhaseMask VARCHAR(64) NOT NULL,
   CH_SIDE VARCHAR(20) NOT NULL,
   CH_ID INT NOT NULL,
   SLAT_ID INT NOT NULL,
   STATION_ID INT NOT NULL,
    DS_CHAMBER VARCHAR(60) NOT NULL,
  DS_CHILDREN VARCHAR(60) NOT NULL,
  DS_SOLARFSM VARCHAR(60) NOT NULL,
   SOL_ID VARCHAR(60) NOT NULL
);
create sequence GBTPE_ID_seq;

create or replace trigger trg_GBTPE_id
     before insert on GBTPhase_Static
     for each row
   begin
     select GBTPE_ID_seq.nextval
       into :new.GBTPE_ID
       from dual;
   end;
/

COMMIT;